import React, { Component } from 'react';

class DiyInfo extends Component {
    static defaultProps = {
        info: {
            img: '',
            name: '이름',
            contents: '내용',
            id: 0
        }
    }
    render() {
        const style = {
            border: '1px solid black',
            padding: '8px',
            margin: '8px'
        };

        const {
            img, name, contents, id
        } = this.props.info;

        return (
            <div style={style}>
                <img src={img} width="10%"/>
                <div><b>{name}</b></div>
                <div>{contents}</div>
            </div>
        );
    }
}

export default DiyInfo;
